INSERT INTO [dbo].[history] ([h_id], [h_year], [h_title_1], [h_title_2], [h_text], [h_order]) VALUES (N'1', N'96年', N'禁紅單', N'禁紅單en', N'&lt;p&gt;一、財政部表示，有關財政部蘇部長接受專訪說明上任4年以來還債約3,700億元，係指107年度至110年度中央政府總預算原編列債務舉借數未舉借，且編列債務還本數均如期償還並再增加還本，各年度分別實質償還債務792億元、885億元、850億元及1,200億元，4年合計實質還債超過3,700億元，並無媒體所稱數字遊戲情事。&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;
二、在全民共同努力下，於國家稅收有餘裕時，財政部適時辦理增加償還債務，並管控債務，使中央政府一年以上債務未償餘額占前三年度GDP平均數比率也自101年底之36.34%下降至110年底之30.01%，提升財政韌性，讓國家面對新冠肺炎疫情等衝擊有足夠能量因應。&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;
三、財政部說明國債鐘數據係中央政府總預算及特別預算之長期債務與短期債務合計數，其中短期債務之舉借係為因應短期庫款收支調度；長期債務增加則主要係為因應全球性肺炎疫情，支應各部會防治、紓困經費及提振景氣資金需求。查國債鐘平均每人負擔已自本(111)年6月26.7萬元，預估8月底下降至25.1萬元。另本年度總預算編列債務還本960億元已全數執行完畢，並將視整體財政情況及歲入執行情形適時增加還本。&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;
四、財政部進一步表示，我國財政管理成效獲國際信用評等公司肯定，110年惠譽、穆迪及標準普爾等三大信評機構將我國信用評等調升或給予正向評價，其中標準普爾復於本年4月再次調升我國主權信用評等，渠等均肯定我國致力於審慎財政及債務管理，遵守財政紀律。&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;新聞稿聯絡人：賴科長佳華&lt;br /&gt;
聯絡電話：02-2322-8352&lt;/p&gt;
', N'4')
GO
GO
INSERT INTO [dbo].[history] ([h_id], [h_year], [h_title_1], [h_title_2], [h_text], [h_order]) VALUES (N'2', N'97年', N'房價仍在漲', N'房價仍在漲en', N'&lt;p&gt;永昌表示，根據內政部《住宅資訊統計彙報》，比較2021年Q1與2022年Q1資料，全國房價所得比已從9.13倍攀9.58倍，另外國泰房地產指數則從去年同期95.17，攀升至今年Q1的121.05，從數據可以發現，房價在政府一系列的打炒房措施後，仍處於上漲趨勢，直言「行政院打炒房政策上，仍然有檢討與精進的空間&lt;/p&gt;
', N'3')
GO
GO
INSERT INTO [dbo].[history] ([h_id], [h_year], [h_title_1], [h_title_2], [h_text], [h_order]) VALUES (N'3', N'98年', N'平均地權條例', N'平均地權條例en', N'&lt;p&gt;民進黨立委&lt;a href=&quot;https://www.facebook.com/iamyungchang&quot; target=&quot;_blank&quot;&gt;江永昌&lt;/a&gt;指出，去（2021）年7月1日「禁止預售屋紅單轉售」新制上路至今超過一年，驚人的是，這段時間以來，全國一件違法案件都沒有，除了中央、地方主管機關的稽查行動查獲案件都掛蛋，也完全無任何民眾檢舉，讓他忍不住大喊「怎麼會這樣，真奇怪」。&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;不僅如此，新制規定交易後30天內須申報，但他向內政部索取資料，卻發現連關於預售屋買賣契約應申報而未申報的統計，都未有明確數字。&lt;/p&gt;
', N'2')
GO
GO
